  Martin Hursthouse\n6-\tBURNETT. Peggie Patience and BANNISTER, Martin Hursthouse
  (cont...).\nresearch has concerned taxonomy and hybridism in the cypresses, and
  he is continuing this work as\ndendrologist ex officio.\n01> BANNISTER, Eva Jane
  m on 12.10.1973 to PATTERSON, Owen Jack (Owie)\nb 19.07.1956\nb 16.11.1953\nJane
  b. and m. at Rotorua. Owie, slo Owen Leslie Patterson (b. 1901, d. 1991) and Joyce
  Margaret\nO'Brien. Address: 116 Homedale Street, Rotorua.\nJane is a florist and
  Owie is a chef. They lived in Brisbane from 1982 to 1990.\n01> PATTERSON, Melanie
  Jane m on 26.04.1997 to WIGGINS, Damien\nb 13.04.1974\nb 30.03.1972\nMelanie b.
  at Rotorua. Address: 9 Turipuku Street, Rotorua.\nMelanie is a child-care teacher
  and Damien is a builder.\n01> WIGGINS, Allysha Jane Winnona\nb 14.01.1995\nAllysha
  b. at Rotorua.\n02> PATTERSON, Bonnie Jean\nb 21.10.1977\nBonnie b. at Rotorua.
  She trained as a chef and is living in Sydney.\n02> BANNISTER, Dorothy Margot m
  on 25.01.1986 to GOODIN, Steven Jeffrey\nb 24.11.1957\nb 23.06.1956\nMargot b. at
  Rotorua and m. at Lake Okareka, Rotorua. Steven, s/o Ivo George Goodin and Evelyn\nWoodroof,
  b. at Milford, Auckland. Address: Wattle Grove, Lake Okareka, Rotorua.\nMargot is
  a kindergarten teacher, Steven graduated in Science from Auckland University. He
  has\nbeen a secondary school teacher and a chemical technician and is now a health
  protection officer.\n01> GOODIN, Ellen Jessie\nb 30.11.1988\nEllen b. at Rotorua.\n02>
  GOODIN, Kristopher Martin\nb 12.03.1991\nKristopher b. at Rotorua.\n02> WILLIAMS,
  Rachel Millicent m on 18.04.1912 to REED, Alfred Vincent Standish\nb 13.05.1886
  d 19.11.1974\nb 06.04.1880 d 10.11.1933\nRachel b, at Pakaraka, m, at Kaharau and
  bd, at Puketapu Cemetery. Stan b. in London and bd, at Puketapu\nCemetery,\nRachel
  was educated at Woodford House when it was still situated in Hastings. She was head
  prefect. Stan\nmanaged \"Pakihiroa\" station until 1921 when he moved to \"Brooklands\"
  at Puketapu.\n01> REED, Richard Sydney m on 27.10.1937 to MURPHY, Elizabeth Muriel\nb
